webpackJsonp([0x91b71ecb891e],{5083:function(t,e){t.exports={data:{post:{html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/05/crh0527.jpg" height="317" width="350" border="0" alt="crh0527.jpg: " /></p>\n<p><a href="http://www.mopo.de/seiten/20000527/sport-artikel19.html">Miracle in St. Pauli</a> (Hamburger Morgenpost, in German). Forget the boring Bundesliga (Munich won the title again, HSV was 3rd). In the last game of the season Hamburg\'s 2nd League team <a href="http://www.fcstpauli.de/umkleide/main.asp">FC St. Pauli</a> scored in the 90th minute to tie and saved themselves from demotion. (I was going to say that FC St. Pauli is Germany\'s version of the <a href="http://www.cubs.de">Chicago Cubs</a>, but <a href="http://davespicks.com/">Dave \'s Picks</a> reminded me of a better match: the <a href="http://www.spsaints.com/">St. Paul Saints</a>. The stadium, by the way,  is across the street from <a href="http://www.stadtplandienst.de/query;ORT=hh;LL=9.970093x53.552014;GR=3">my new office</a>.)</p>',fields:{title:"Learning to Sit Up (a little bit)",date:"27 May 2000",url:"https://papascott.de/2000-05-27-learning-to-sit-up-a-little-bit/"}}},pathContext:{slug:"/2000-05-27-learning-to-sit-up-a-little-bit/",prev:{fields:{title:"Sucking on Spangle",date:"25 May 2000",slug:"/2000-05-25-sucking-on-spangle/"}},next:{fields:{title:"Dodenhof",date:"28 May 2000",slug:"/2000-05-28-dodenhof/"}}}}}});
